    // Assuming there's a button with the text 'Generate Test Accounts'
    await page.waitForSelector('text=Generate Test Accounts');
    await page.click('text=Generate Test Accounts');

    // Wait for the accounts to be generated (assuming some loading indicator)
    await page.waitForSelector('.loading-indicator', { state: 'hidden' });

