    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_accounts_generated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_accounts_generated.png'));

    // Extract meaningful data to verify task completion
    const accountsList = await page.$$eval('.account-item', accounts => accounts.map(account => account.textContent));

