import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on the mobile menu toggle to access the admin panel
    await page.waitForSelector('#mobile-menu-toggle', { timeout: 5000 });
    await page.click('#mobile-menu-toggle');

    // Wait for the admin panel to load
    await page.waitForSelector('.admin-panel', { timeout: 5000 });

    // Click on 'Generate Test Accounts' button
    await page.waitForSelector('button:has-text("Generate Test Accounts")', { timeout: 5000 });
    await page.click('button:has-text("Generate Test Accounts")');

    // Wait for the confirmation or result of account generation
    await page.waitForSelector('.account-generation-success', { timeout: 5000 });

    // Take a screenshot of the result
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_account_generated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_account_generated.png'));

    // Extract relevant data to verify accounts were generated
    const generatedAccounts = await page.evaluate(() => {
      return Array.from(document.querySelectorAll('.generated-account')).map(account => account.textContent);
    });

    return {
      success: true,
      action: "Generated fake user accounts successfully",
      extractedData: { generatedAccounts },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
